export class EvaluationCatalogue {
  constructor(title, image) {
    this.title = title;
    this.image = image;
  }

  get Id() {
    return this.id;
  }

  set Id(id) {
    this.id = id;
  }

  get Title() {
    return this.title;
  }

  set Title(title) {
    this.title = title;
  }

  get Image() {
    return this.image;
  }

  set Image(image) {
    this.image = image;
  }

